The @virtual directive instructs the indexer's SQL schema builder to not build SQL tables from types that include this directive on any field. type Title @entity { name: CharField! @virtual
} type Book @entity { id: ID! title: Title!
} When SQL tables are generated for the entities above, a table will be created for Book, but no table will be created for Title. Rather, the title field on the Book object will exist on the book table as a JSON field. Important: When using the @virtual directive with GraphQL union types, each member of the union type must either include only types that are not virtual, or only types that are virtual. We do not support mixing and matching virtual types with non-virtual types in unions.

