The Fuel indexer supports foreign keys on entity types; thus, you can also ask for information about a referenced entity inside of your query. A nested query has the following general structure: query { entityA { field_A1 field_A2 referenced_entityB { field_B1 field_B2 ... } ... } ...
} Essentially, it's the same as the basic query example with an added sub-block to request information about the reference entity. The response from the API server will be returned in the same general structure as the query. Let's look at another example to illustrate how it works in practice. Important: There is no limit to how deeply nested your entities and queries can be. However, every nested reference will add computation and latency to your query as the information will have to be retrieved from different tables in your storage backend. Please exercise caution in your entity design and try to minimize nesting as much as possible. We'll start with the following example schema: type City @entity { id: ID! name: Charfield!
} type Library @entity { id: ID! name: Charfield! city: City!
} type Book @entity { id: ID! title: Charfield! library: Library!
} type Character @entity { id: ID! name: Charfield! book: Book!
} This schema uses implicit foreign keys to reference other entities; for more information on implicit and explicit foreign keys, please refer to the Foreign Keys section of the book. In this contrived example, we're storing information about characters that are found in books which are stored in libraries that can be found in cities. This will be the query that we use to retrieve the aforementioned data: query { character { name book { title library { name city { name } } } }
} Let's assume that we've created an indexer for this data and the indexed data has been stored in the database. If we send the query, we'll get the following response: [ { "name": "Lil Ind X", "book": { "title": "Fuel Indexer", "library": { "name": "Fuel Labs Library", "city": { "name": "Fuel City" } } } }
]

